import React from 'react'
import Link from 'next/link';
import { Button } from 'antd';
import "../style/index.css"
import dynamic from 'next/dynamic'
import Luna from '../components/Luna'
import Ske from '../layout/Ske'
import { inject, observer } from "mobx-react"
const RustComponent = dynamic({
  loader: async () => {
    let cc = await import('../public/pkg/wasm_pack.js')
    let dd = await import('../public/pkg/wasm_pack_bg.wasm')
    return () => (
      <Ske>
        <Juicy www={cc} mmm={dd} />
      </Ske>
    )
  },
})
@inject('store')
@observer
class Juicy extends React.Component {
  constructor(props) {
    super(props)
  }
  render() {
    return (
      <div>
        <p className="mona">Hey jude</p>
        <Button type="primary" onClick={()=>{console.log("!!");this.props.store.add()}}>hey Jude</Button>
        <div>
          <Link href='/about' ><a>about page{this.props.store.val1}</a></Link>
        </div>
        <Luna />
        <style jsx>{
          `
          .mona{
            color:blue
          }
          `
        }</style>
      </div>
    )
  }
  componentDidMount() {
    console.log(this.props.www)
    console.log(this.props.mmm)
  }
}
export default RustComponent
